## Create a Tooltip in NextJS using React Context

### Step 1: Create a Tooltip Context

Create a new file called TooltipContext.js and add the following code:
```
import { createContext } from "react";

const TooltipContext = createContext();

export default TooltipContext;
```
### Step 2: Create a TooltipProvider

Create a new file called TooltipProvider.js and add the following code:
```
import { useState } from "react";
import TooltipContext from "./TooltipContext";

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  const openTooltip = (tooltip) => {
    setTooltip(tooltip);
  };

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider
      value={{
        tooltip,
        openTooltip,
        closeTooltip,
      }}
    >
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```
### Step 3: Create a Tooltip component

Create a new file called Tooltip.js and add the following code:
```
import { useContext } from "react";
import TooltipContext from "./TooltipContext";

const Tooltip = ({ children, tooltip }) => {
  const { closeTooltip } = useContext(TooltipContext);

  return (
    <div className="tooltip">
      <div className="tooltip__content">{tooltip}</div>
      <div className="tooltip__close" onClick={closeTooltip}>
        &times;
      </div>
      {children}
    </div>
  );
};

export default Tooltip;
```
### Step 4: Use the Tooltip component

Now we can use the Tooltip component in our application. For example, we can create a button that opens a tooltip when clicked:
```
import TooltipProvider from "./TooltipProvider";
import Tooltip from "./Tooltip";

const App = () => {
  return (
    <TooltipProvider>
      <Tooltip tooltip="This is a tooltip">
        <button>Click me</button>
      </Tooltip>
    </TooltipProvider>
  );
};

export default App;
```
In this example, we are using the TooltipProvider to provide the TooltipContext to our application. We are then using the Tooltip component to create a tooltip that is displayed when the button is clicked. The tooltip is closed when the closeTooltip function is called.

## Conclusion

In this article, we have created a Tooltip component in NextJS using React Context. We have used the TooltipContext to create a global state for the Tooltip component, which allows us to open and close tooltips from anywhere in our application. We have also used the TooltipProvider to provide the TooltipContext to our application. Finally, we have used the Tooltip component to create a tooltip that is displayed when the button is clicked. The tooltip is closed when the closeTooltip function is called.
